<?php

declare(strict_types=1);

namespace Webauthn\Tests\Functional;

use Webauthn\PublicKeyCredentialCreationOptions;
use Webauthn\Tests\MemoryPublicKeyCredentialSourceRepository;

/**
 * @internal
 */
final class ConformanceTest extends AbstractTestCase
{
    /**
     * P-2 Send a valid ServerAuthenticatorAttestationResponse with FULL "packed" attestation that contains chain that
     * links to the root certificate in the metadata in it's response, and check that server succeeds
     *
     * @test
     * @dataProvider responsesWithLink
     */
    public function validAttestationResponseWithLinkShouldSucceed(string $options, string $response): void
    {
        //Given
        $publicKeyCredentialCreationOptions = PublicKeyCredentialCreationOptions::createFromString($options);
        $publicKeyCredential = $this->getPublicKeyCredentialLoader()
            ->load($response);
        $credentialRepository = new MemoryPublicKeyCredentialSourceRepository();
        $request = $this->createRequestWithHost('webauthn.spomky-labs.com');

        // When
        $pkSource = $this->getAuthenticatorAttestationResponseValidator($credentialRepository)
            ->check($publicKeyCredential->getResponse(), $publicKeyCredentialCreationOptions, $request);

        //Then
        static::assertSame('80f53d1e-852e-43ed-bb3f-d02f1322e5af', $pkSource->getAaguid()->toRfc4122());
    }

